import UploadVideo from './components/UploadVideo';
import WebcamCapture from './components/WebcamCapture';



function App() {
  return (
    <div style={{ textAlign: 'center', padding: '20px' }}>
      <h1>Bad Posture Detection App</h1>
      <UploadSection />
      <hr />
      <WebcamSection />
    </div>
  );
}

export default App;
